public class Part3 {
    
        public int findStopCodon(String dna, int startIndex, String stopCodon) {
        
        int currIndex = dna.indexOf(stopCodon, startIndex + 3);
        
        while (currIndex != -1) {
            int diff = currIndex - startIndex;
            if (diff % 3 == 0) {
                return currIndex;
            }
            else {
                currIndex = dna.indexOf(stopCodon, currIndex + 1);
            }
        }
        return dna.length();
    }
    
    public String findGene(String dna) {
        
        int startIndex = dna.indexOf("ATG");
        if (startIndex == -1) return "";
        
        int taaIndex = findStopCodon(dna, startIndex, "TAA");
        int tagIndex = findStopCodon(dna, startIndex, "TAG");
        int tgaIndex = findStopCodon(dna, startIndex, "TGA");
        
        int minIndex = Math.min(taaIndex, Math.min(tagIndex, tgaIndex));
        
        if (minIndex == dna.length()){
            return "";
        }
        
        return dna.substring(startIndex, minIndex + 3);
    }
    
    public void printAllGenes(String dna) {
        int startIndex = 0;
        
        while ( true ) {
            String currentGene = findGene(dna.substring(startIndex));
            if (currentGene.isEmpty()) {
                break;
            }
            System.out.println(currentGene);
            startIndex = dna.indexOf(currentGene, startIndex) + currentGene.length(); 
        }
    }
    
    public int countGene(String dna) {
        int startIndex = 0;
        int count = 0;
        while ( true ) {
            String currentGene = findGene(dna.substring(startIndex));
            if (currentGene.isEmpty()) {
                break;
            }
            count++;
            startIndex = dna.indexOf(currentGene, startIndex) + currentGene.length(); 
        }
        
        return count;
    }
    
    public void testcountGene() {
        String dna = "ATGTAAGATGCCCTAGT";
        int count = countGene(dna);
        if (count != 2) System.out.println("Error");
        else            System.out.println("Occurs " + count); 
        
        dna = "";
        count = countGene(dna);
        if (count == 0) System.out.println("Error");
        else            System.out.println("Occurs " + count);
        
        dna = "";
    }
}
